import React from 'react';


function Header() {
  return (
<div className='header'>
  <div className='logo'>
    <img src='#' alt='#'/>
    <a href='#' alt>კონტაკტი</a>    
  </div>
<button href='#'>საოპერაციო</button>
<button href='#'>ფინანსები</button>
<button href='#'>ადმინისტრაცია</button>
<button href='#'>გაყიდვები</button>
<button href='#'>მარკეტინგი</button>
<button href='#'>პავილიონები</button>
<button href='#'>ტექნიკური</button>
</div>
  );
}

export default Header;
